2016-11-16 11:35:53------>array (
  0 => 'INSERT INTO `go_shoplist` (`cateid`, `brandid`, `title`, `title_style`, `title2`, `keywords`, `description`, `money`, `yunjiage`, `zongrenshu`, `canyurenshu`,`shenyurenshu`, `qishu`,`maxqishu`,`thumb`, `picarr`, `content`,`xsjx_time`,`renqi`,`pos`, `time`) VALUES (\'14\', \'70\', \'OPPO R9 4GB+64GB内存版 金色 全网通4G手机 双卡双待\', \'\', \'\', \'\', \'\', \'2999\', \'1\', \'2999\', \'0\',\'2999\', \'1\',\'10000\', \'shopimg/20161116/74044564267336.jpg\', \'a:1:{i:0;s:35:"shopimg/20161116/15426706267344.jpg";}\', \'<p style="text-align: center;"><img alt="" class="" src="http://img11.360buyimg.com/cms/jfs/t2491/159/2019551357/51362/618e239b/56e9360aN90d0847f.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="text-align: center;"><img alt="" class="" src="http://img13.360buyimg.com/cms/jfs/t2701/122/1638574320/47778/17bbd8b3/574405c8N9e52a3eb.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 190px; left: 35px; width: 680px; text-align: center; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120);">OPPO R9配备了2850mAh大电池，搭载VOOC闪充、功耗更低的新一代处理器、更加省电的新一代ColorOS 3.0，续航能力比前代大幅提升。VOOC闪充采用OPPO独立研发的低压快充方案，充电更快更安全，已超过1000万人正在使用*。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 285px; left: 35px; width: 680px; text-align: center; line-height: 16px; color: rgb(180, 180, 180);">* 该数据基于特定环境下由实验室检测所得，实际充电效果因电池容量和温度等因素影响或有差异，实际通话时间因手机使用状态和使用环境不同而有所差异。</p><p style="text-align: center;"><img alt="" class="" src="http://img30.360buyimg.com/cms/jfs/t2710/329/3059403596/130129/ccd36fa7/577f6ee1N2321978e.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 450px; left: 35px; width: 680px; text-align: center; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120);">拍摄一张满意自拍照的愿望由来已久，今天终于能够实现。<br/>OPPO全新定制画质更好的1600万像素摄像头、美得更加自然的美颜4.0。软硬件全新升级，让自拍照的画质更细腻、肌肤更通透、轮廓更立体，眼神更明亮，恰到好处的拍出你的美。</p><p style="text-align: center;"><img alt="" class="" src="http://img12.360buyimg.com/cms/jfs/t1876/263/2745427406/69043/8120845d/56e9360dN655c6028.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 145px; left: 35px; width: 680px; text-align: center; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120);">惊艳而不妥协的设计会促进技术的进步。<br/>这一次，R9惊艳的超窄边框一定会让你留下深刻印象。从亮屏时屏幕黑边到手机白边边缘，R9窄至1.66mm，亮屏时黑边仅为0.5mm，为了让超窄边与屏幕长久稳固使用成为可能，工程师们花费8个月时间自主研发U型轨喷胶工艺，让屏幕更无界又格外坚韧。</p><p style="text-align: center;"><img alt="" class="" src="http://img13.360buyimg.com/cms/jfs/t1837/251/2606490040/65834/2969aa52/56e9360dN936e303a.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 250px; left: 35px; width: 320px; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120); text-align: center;">好手感背后，是触感和握持感的全面提升。<br/>工程师们甄选220号精细锆砂，逐一测试喷砂颗粒、风力和摇摆参数，打造R9细腻均匀触感；精心排布每一个元器件，在0.1mm范围内反复调整凝光腰线位置，握起来轻薄不咯手，贴合掌心。</p><p style="text-align: center;"><img alt="" class="" src="http://img11.360buyimg.com/cms/jfs/t2494/160/2029579478/55840/76b3e740/56e9360eN06802b79.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 150px; left: 35px; width: 680px; text-align: center; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120);">指纹是无需记忆的密码，它独特而安全。R9采用正面指纹识别，息屏或亮屏状态下指纹解锁快至0.2s，并支持支付宝、微信指纹支付，重要软件与文件夹指纹加密。R9指纹识别不止于快，更采用具备自学习能力的学习型指纹识别系统，用户多次使用指纹识别功能后，后台数据信息会越来越贴近主人真实指纹，越用越精确。</p><p style="text-align: center;"><img alt="" class="" src="http://img11.360buyimg.com/cms/jfs/t2245/310/2025423948/150662/ad2083b4/56e9360eN200d2ed0.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 250px; left: 35px; width: 320px; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120); text-align: center;">R9支持4G双卡双待，全网通2.0，它比全网通1.0更方便的是，你可以选择两张卡中的任意一张使用4G网络，让每张卡的流量都获得充分利用。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; position: absolute; top: 1100px; left: 375px; width: 320px; font-size: 14px; line-height: 28px; color: rgb(120, 120, 120); text-align: center;">R9采用4GB超大运行内存和64GB超大存储内存的组合，运行速度更快，存储更多。更支持128GB内存扩展，手机不再显得拥挤，你的照片、视频和爱听的歌曲，都可存放更多。</p><p style="text-align: center;"><img alt="" class="" src="http://img14.360buyimg.com/cms/jfs/t2149/194/2326931928/108138/8ea30df2/56fde3cfNa77dbc17.jpg" style="margin: 0px; padding: 0px; border: 0px; vertical-align: middle;"/></p><p><br/></p>\',\'0\',\'1\', \'1\',\'1479267353\')',
